import React from "react";

const ResultsPage = ({ onRestartGame, outputData, selectedCards }) => {
  const [rankings, setRankings] = useState(null);

  useEffect(() => {
    // Convert selected cards to an array of card IDs
    const cardIds = selectedCards.map((card) => card.ID);

    // Define the demographics
    const demographics = { Race: "White" };

    // Send request to server
    fetch("/data/rankings", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ cards: cardIds, demographics: demographics }),
    })
      .then((response) => response.json())
      .then((data) => {
        // The rankings received from the server
        setRankings(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  }, [selectedCards]);

  console.log(rankings);
  return (
    <div>
      <h1>Results</h1>
      <button onClick={onRestartGame}>Restart Game</button>
    </div>
  );
};

export default ResultsPage;
